import React from "react";

const CharacterTile = ({ character }) => {
  const { name, status, image } = character;
  return (
    <div style={styles.tile}>
      <h1>{name}</h1>
      <h1>{status}</h1>
      <img src={image} alt={name} width="50" />
    </div>
  );
};

const styles = {
  tile: {
    border: "1px solid #fff",
  },
};

export default CharacterTile;
